    //leetcode submit region begin(Prohibit modification and deletion)
    class Solution {
        public int[][] updateMatrix(int[][] mat) {
            int[][] distance = new int[mat.length][mat[0].length];

            Queue<Pair<Integer, Integer>> queue = new ArrayDeque<>();

            boolean[][] visited = new boolean[distance.length][distance[0].length];


            for (int i = 0; i < distance.length; i++) {
                for (int j = 0; j < distance[0].length; j++) {
                    if (mat[i][j] == 0) {
                        distance[i][j] = 0;
                        visited[i][j] = true;
                        queue.add(new Pair<>(i, j));
                    } else {
                        distance[i][j] = Integer.MAX_VALUE;
                    }
                }
            }


            bfs(mat, distance, visited, queue);
//
//            for (int i = 0; i < distance.length; i++) {
//                for (int j = 0; j < distance[0].length; j++) {
//                    if (mat[i][j] == 0) {
//                        visited
//
//                    }
//                }
//            }


//            Utils.printTable(distance);
            return distance;
        }


        private void bfs(int[][] mat, int[][] distance, boolean[][] visited, Queue<Pair<Integer, Integer>> queue) {

            while (!queue.isEmpty()) {
                Pair<Integer, Integer> poll = queue.poll();


                int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

                int currentDistance = distance[poll.getKey()][poll.getValue()];


                for (int[] direction : directions) {
                    int nextX = poll.getKey() + direction[0];
                    int nextY = poll.getValue() + direction[1];


                    if (isNotSafePosition(distance, nextX, nextY)) {
                        continue;
                    }
                    if (visited[nextX][nextY]) {
                        continue;
                    }

                    if (distance[nextX][nextY] <= currentDistance + 1) {
                        continue;
                    }


                    distance[nextX][nextY] = currentDistance + 1;
                    visited[nextX][nextY] = true;
                    queue.add(new Pair<>(nextX, nextY));
                }
            }

        }

        private boolean isNotSafePosition(int[][] mat, int i, int j) {
            return i < 0 || j < 0 || i >= mat.length || j >= mat[0].length;
        }
    }
